const BoxSearch = styled.div`
   padding-bottom: 2%;
`
const Boton = styled.input`

`

export default function SearchBar({OnSearch}) {
   return (
      <BoxSearch>
          <Boton type='search' />
         <button onClick={(id) =>{OnSearch(id)}}>Agregar</button>
      </BoxSearch>
   );
}
